import React from "react";
import '../App.css';
import Button from "../components/Button";


const Todos = (props) =>{
    return (
       <div className="todos_wrapper">
        <ul className="todos">
        {props.todos.map((todo)=> {
            <li key = {todo.id}>
            <input type="checbox" />
            <p>{todo.text}</p>
            <Button text ="Удалить Todo"/>
        </li>

        })}
        </ul>
       </div>

    )
}

export default Todos;
